// About.js
import React from 'react';
import { Link } from 'react-router-dom';
import './about.css';
import imagen from '../IMG/fondo_control.jpg'

function About() {
    return (
        <>
            <Link to="/home" className="linkButton">
                <button>Volver al Inicio</button>
            </Link>
            <div className="container">
        
                <div>
                    <h1 className="title">PI HENRY VIDEOGAMES 2024</h1>
                    <h1>Mirko Miler</h1>
                    <img src={imagen} alt="foto" className="imagen" />
                </div>
                
            </div>
        </>
    );
}

export default About;
